messages.content:
Heres a focused review at 325px width with actionable fixes. Overall vibe is strong, but there are several mobile usability issues (touch size, spacing, and readability).

---

## 1) Layout overflow
**Issue:** The Why this horse text block and stat cards feel tight but dont visibly overflow. However, the **long line lengths** and **card padding** are pushing content close to edges on small screens.  
**Fix:** Add more internal padding and reduce max width so text doesnt feel cramped.

```css
.card,
.result-card,
.preference-card {
  padding: 20px 16px;
}

.container,
.page-content {
  padding-left: 16px;
  padding-right: 16px;
}
```

---

## 2) Touch targets (44px minimum)
**Issue:** The Back to Horses link (top) and the Back button inside the wizard look under 44px height.  
**Fix:** Force minimum height and vertical padding.

```css
a.back-link,
button.back-button,
.button.back {
  min-height: 44px;
  padding: 10px 14px;
}
```

---

## 3) Text readability (small phone)
**Issue:** Body and helper text are too small and low-contrast on dark background. The italic serif body copy is especially hard to scan.  
**Fix:** Increase size + line-height + slightly lighten color.

```css
body,
p,
.helper-text,
.card p {
  font-size: 16px;
  line-height: 1.5;
  color: #d8d2c7;
}

.italic,
.emphasis {
  font-style: normal; /* reserve italics for emphasis only */
}
```

---

## 4) Navigation buttons
**Issue:** Back/Next stack is okay, but spacing feels uneven (Back is small, Next is dominant). Back is also too close to Next.  
**Fix:** Standardize width and add spacing.

```css
.button-row {
  display: grid;
  gap: 12px;
}

.button-row .button {
  width: 100%;
  min-height: 48px;
}
```

---

## 5) Quick option buttons
**Issue:** Option buttons are too small and crowded. Some labels wrap (e.g., Chapter 3, just got to Rhodes), which makes each button taller but still not full-widthharder to tap.  
**Fix:** Make them full-width, increase padding, and add consistent spacing.

```css
.quick-options .option-button {
  width: 100%;
  min-height: 48px;
  padding: 12px 14px;
  text-align: left;
}

.quick-options {
  display: grid;
  gap: 10px;
}
```

---

## 6) Horse cards + stats
**Issue:** The horse image box is large relative to screen width and pushes text/stats down. Stats cards are small and likely <44px tall.  
**Fix:** Reduce image container size, tighten header spacing, and enforce readable stats.

```css
.horse-card .image-wrapper {
  max-width: 220px;
  margin: 0 auto 12px;
}

.horse-card .stat {
  min-height: 44px;
  font-size: 14px;
  padding: 8px;
}
```

Also, the badge #1 floats to the right and gets cramped on small screens.  
**Fix:** Move it into the title row or stack it.

```css
.horse-card .badge {
  position: static;
  margin-top: 8px;
  display: inline-block;
}
```

---

## 7) Chat bubble / AI response formatting
**Issue:** The Why this horse block is long and reads like a wall of text. Line length is too wide for a 325px device; italic serif makes it worse.  
**Fix:** Add paragraph spacing and trim line length.

```css
.reasoning {
  font-size: 15px;
  line-height: 1.5;
  max-width: 100%;
}

.reasoning p {
  margin-bottom: 10px;
}
```

---

### Summary of Highest Priority Fixes
1. **Make all buttons/links >= 44px** (Back link + option buttons).  
2. **Increase body copy size to 16px+** and remove excessive italics.  
3. **Make quick options full-width** to improve tap accuracy.  
4. **Reduce image container size** and fix badge positioning.

If you can share class names from the actual markup, I can give exact selector-specific fixes.
